const selectedMenu = "Home";
function MenuItem(props) {
    return (
        <Button variant={(props.item.toString() == selectedMenu.toString()) ? "contained" : "text"} >
            {/* style={{ background: "#FF0077" }} */}
            {console.log(props.item, selectedMenu)}
            {props.item}
        </Button >
    )
}

export default MenuItem;
